import Button from './Button';

export default function Banner({ img, imgAltTest, text = 'Banner Component' }) {

	return (

		<div className='banner'>

            <img
                alt=''
                className={`fm-banner__img fm-banner__img--lg img-fluid`}
                src={img}
            />

            <span className='visually-hidden'>{text}</span>

            <Button />
        </div>

	)

}
